import './header.css';
import {Link} from 'react-router-dom'

function Header() {
  return (
    <header>
        <Link className='logo' to="/favoritos">PrimeFlix</Link>
        <Link className='home' to="/">Home</Link>
        <Link className='favoritos' to="/favoritos">Meus Filmes</Link>
    </header>
  );
}

export default Header;
